package org.jhm69.battle_of_quiz.models;public class Player {    long score, lastTimestamp;    private String id, name, image, institute, dept;    public Player(String id, String name, String image, String institute, String dept, long score, long lastTimestamp) {        this.id = id;        this.name = name;        this.image = image;        this.institute = institute;        this.dept = dept;        this.score = score;        this.lastTimestamp = lastTimestamp;    }    public Player(String id, String name, String image, long score, long lastTimestamp) {        this.id = id;        this.name = name;        this.image = image;        this.score = score;        this.lastTimestamp = lastTimestamp;    }    public Player() {    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getImage() {        return image;    }    public void setImage(String image) {        this.image = image;    }    public String getInstitute() {        return institute;    }    public void setInstitute(String institute) {        this.institute = institute;    }    public String getDept() {        return dept;    }    public void setDept(String dept) {        this.dept = dept;    }    public long getScore() {        return score;    }    public void setScore(long score) {        this.score = score;    }    public long getLastTimestamp() {        return lastTimestamp;    }    public void setLastTimestamp(long lastTimestamp) {        this.lastTimestamp = lastTimestamp;    }}